2023 for me has had so many Ups and downs. I’m excited for what’s ahead in 2024.
As most of you know I founded Sisters in Sports in 2020. Due to pandemic it didn’t take off until end of 2022. Since then we have been growing fast. My friend and newly appointed cofounder in 2023 @oksanamasters will be unstoppable with the rest of our @sistersinsports  athletes, mentors and family.
@sistersinsports  2023 was a year of triumphs and empowerment for Sisters in Sports Foundation! We shattered barriers and fueled the dreams of women and girls with disabilities through sports. Looking back, it was a year of milestones with new co-founder, athletes, and mentors. In 2024, we’re expanding our community, enhancing programs, and inviting you to join us in fundraising. Stay connected, spread the word, and get involved to empower our athletes. Let’s make 2025 a year of boundless empowerment and triumph! #SistersInSports #Empo
